				CAKE_LDAP_LDAP_ATTRIBUTE_TITLE => 'Ведущий инженер',
			],
			CAKE_LDAP_LDAP_ATTRIBUTE_PHOTO => '',
		];
		$this->assertData($expected, $result);
	}

